import React from "react";
import {
  ButtonStyle,
  NameStyle,
  PresentationStyle,
  WelcomeStyle,
} from "../../styles/FrontPageStyle/FrontPage.style.ts";

const Button = styled.button`
  background: transparent;
  border-radius: 3px;
  border: 2px solid #BF4F74;
  color: #BF4F74;
  margin: 0 1em;
  padding: 0.25em 1em;
`

function Presentation() {
  return (
    <PresentationStyle>
      <WelcomeStyle>
        <h1>Welcome</h1>
      </WelcomeStyle>
      <NameStyle>
        <h2>I'm Ryad Laouedj</h2>
      </NameStyle>
      <p>
        Creative developer & student at 42 Paris. Between Design & Code I try to
        create intuitive interfaces for user through a Logic & Organized based
        code.
      </p>
      <ButtonStyle>
        <button>button</button>
      </ButtonStyle>
    </PresentationStyle>
  );
}

export default Presentation;
